    :root { --bg:#0b0f14; --card:#1a2430; --ink:#5cc8ff; --muted:#9fb0c0; --accent:#2563eb; }
    *{box-sizing:border-box} body{margin:0;font-family:system-ui,-apple-system,Segoe UI,Roboto,Helvetica,Arial,sans-serif;background:var(--bg);color:var(--ink)}
    .wrap{max-width:1000px;margin:0 auto;padding:24px}
    .header{display:flex;gap:16px;justify-content:space-between;align-items:center;margin-bottom:20px;flex-wrap:nowrap}
    h1{font-size:28px;margin:0}
    a { color: #5cc8ff; }
    .controls{display:flex;gap:10px;flex-wrap:nowrap;align-items:center}
    .btn{color:#5cc8ff;appearance:none;border:0;background:var(--card);box-shadow:0 1px 2px rgba(0,0,0,.06);border-radius:16px;padding:10px 14px;cursor:pointer;white-space:nowrap}

    .card{background:var(--card);border-radius:16px;padding:14px;box-shadow:0 1px 2px rgba(0,0,0,.06)}
    .row{display:flex;justify-content:space-between;align-items:center;margin-bottom:8px}
    .name{text-transform:capitalize;font-weight:600}
    input[type="range"]{width:100%}
    .meta{font-size:12px;color:var(--muted)}
    .out{background:var(--card);border-radius:16px;padding:18px;box-shadow:0 1px 2px rgba(0,0,0,.06)}
    .bar{height:16px;background:#e5e7eb;border-radius:999px;overflow:hidden}
    .fill{height:100%;background:var(--accent);width:0%}
    .pct{font-size:28px;font-weight:800;min-width:120px;text-align:right}
    .flex{display:flex;gap:16px;align-items:center}
    @media (max-width:480px){
      .header{flex-direction:column;align-items:flex-start}
      .controls{width:100%}
    }
  </style>

function dense_rowbias(src, w, inDim, outDim, userelu = true)
{
  const dst = new Float32Array(outDim);
  const stride = inDim + 1;
  for(let i = 0; i < outDim; i++)
  {
    const base = i * stride;
    let s = w[base + inDim];
    for(let k = 0; k < inDim; k++){s += w[base + k] * src[k];}
    dst[i] = userelu ? (s > 0 ? s : 0) : s;
  }
  return dst;
}
function forward(x)
{
  const h0 = dense_rowbias(x,  L0, 27,  256, true);
  const h1 = dense_rowbias(h0, L1, 256, 256, true);
  const h2 = dense_rowbias(h1, L2, 256, 256, true);
  const h3 = dense_rowbias(h2, L3, 256, 256, true);
  const h4 = dense_rowbias(h3, L4, 256, 256, true);
  const h5 = dense_rowbias(h4, L5, 256, 256, true);
  const h6 = dense_rowbias(h5, L6, 256, 128, true);
  return     dense_rowbias(h6, L7, 128, 1,   false)[0];
}

const TRAITS = [
  "fatness","curiosity","empathy","ambition","positivity","depressive","creativity","intellectual","spiritual","traditional","loyalty","stability","emotionality","nurturing","affectionate","possessive","dominant","openness","defiant","independent","trustworthy","sociability","humor","risk-taking","adventurous","quirkiness","crazy"
];

const slidersEl = document.getElementById('sliders');
const pctText = document.getElementById('pctText');
const barFill = document.getElementById('barFill');

// Keep slider values as 1..10 integers.
const values = new Array(27).fill(5);

// Convert to 0..1 floats *after* reading sliders.
function toScaled(){ return Float32Array.from(values.map(v => Math.max((v - 1), 0) / 9)); }

function renderSliders(){
  slidersEl.innerHTML = '';
  TRAITS.forEach((name, i) => {
    const card = document.createElement('div'); card.className = 'card';
    const row = document.createElement('div'); row.className = 'row';
    const spanName = document.createElement('span'); spanName.className = 'name'; spanName.textContent = name;
    const spanVal = document.createElement('span'); spanVal.className = 'meta'; spanVal.textContent = values[i] + ' / 10';
    row.append(spanName, spanVal);
    const input = document.createElement('input'); input.type='range'; input.min=1; input.max=10; input.step=1; input.value=values[i];
    input.addEventListener('input', e => { values[i] = parseInt(e.target.value,10); spanVal.textContent = values[i] + ' / 10'; update(); });
    card.append(row, input);
    slidersEl.append(card);
  });
}

function update(){
  try{
    const x = toScaled();
    const o = forward(x);
    const pct = Math.max(0, Math.min(1, o)) * 100; // clamp for gauge
    barFill.style.width = pct.toFixed(2) + '%';
    pctText.textContent = pct.toFixed(2) + '%';
  } catch(err){
    pctText.textContent = '';
    barFill.style.width = '0%';
  }
}

document.getElementById('resetBtn').addEventListener('click', () => { for(let i=0;i<27;i++) values[i]=5; renderSliders(); update(); });
document.getElementById('randBtn').addEventListener('click', () => { for(let i=0;i<27;i++) values[i]=Math.round(Math.random()*10); renderSliders(); update(); });
document.getElementById('minBtn').addEventListener('click', () => { for(let i=0;i<27;i++) values[i]=1; renderSliders(); update(); });
document.getElementById('maxBtn').addEventListener('click', () => { for(let i=0;i<27;i++) values[i]=10; renderSliders(); update(); });

renderSliders();
update();
    </script>
